import * as React from 'react'
import { Text, StyleSheet, View, Pressable, Image } from 'react-native'
import { useNavigation } from '@react-navigation/native'
import { Padding, FontSize, Color, FontFamily, Border } from '../GlobalStyles'

const Favoritos1 = () => {
  const navigation = useNavigation()

  return (
    <View style={styles.favoritos}>
      <View style={[styles.frameParent, styles.parentSpaceBlock]}>
        <View>
          <Text style={[styles.tusFavoritos, styles.imGoingToFlexBox]}>
            TUS FAVORITOS
          </Text>
        </View>
        <View style={[styles.frameWrapper, styles.frameSpaceBlock]}>
          <View style={styles.groupParentFlexBox}>
            <Text style={styles.tusListasTypo}>Tus listas</Text>
          </View>
        </View>
        <Pressable
          style={[styles.frameContainer, styles.frameSpaceBlock]}
          onPress={() => navigation.navigate('Favoritos')}
        >
          <View style={styles.frameGroup}>
            <View style={styles.pruebasDeCiclismoWrapper}>
              <Text style={styles.tusListasTypo}>Pruebas de ciclismo</Text>
            </View>
            <Text style={[styles.imGoingTo, styles.imGoingToFlexBox]}>
              (2) Pruebas añadidas
            </Text>
          </View>
        </Pressable>
        <View style={[styles.frameContainer, styles.frameSpaceBlock]}>
          <View style={styles.frameGroup}>
            <View style={styles.pruebasDeSenderismocaminataWrapper}>
              <Text
                style={[
                  styles.pruebasDeSenderismocaminata,
                  styles.tusListasTypo
                ]}
              >
                Pruebas de senderismo/caminata
              </Text>
            </View>
            <Text style={[styles.imGoingTo, styles.imGoingToFlexBox]}>
              (1) Pruebas añadidas
            </Text>
          </View>
        </View>
      </View>
      <View style={styles.menInferior}>
        <View style={[styles.groupParent, styles.groupParentFlexBox]}>
          <Pressable
            style={styles.wrapper}
            onPress={() => navigation.navigate('UltimasConsultas')}
          >
            <Image
              style={styles.icon}
              contentFit="cover"
              source={require('../assets/group-1171276700.png')}
            />
          </Pressable>
          <Pressable
            style={[styles.vector, styles.frameLayout]}
            onPress={() => navigation.navigate('Favoritos1')}
          >
            <Image
              style={styles.icon}
              contentFit="cover"
              source={require('../assets/vector1.png')}
            />
          </Pressable>
          <Image
            style={styles.capturaDePantalla20231124}
            contentFit="cover"
            source={require('../assets/captura-de-pantalla-20231124-114115-1.png')}
          />
          <Pressable
            style={[styles.container, styles.frameLayout]}
            onPress={() => navigation.navigate('HistorialDePruebas')}
          >
            <Image
              style={styles.icon}
              contentFit="cover"
              source={require('../assets/frame-1547756022.png')}
            />
          </Pressable>
          <Pressable
            style={[styles.frame, styles.frameLayout]}
            onPress={() => navigation.navigate('TuPerfil')}
          >
            <Image
              style={styles.icon}
              contentFit="cover"
              source={require('../assets/group-1171276701.png')}
            />
          </Pressable>
        </View>
        <Image
          style={styles.menInferiorChild}
          contentFit="cover"
          source={require('../assets/ellipse-7194.png')}
        />
      </View>
    </View>
  )
}

const styles = StyleSheet.create({
  parentSpaceBlock: {
    paddingHorizontal: Padding.p_xl,
    width: 360,
    position: 'absolute'
  },
  imGoingToFlexBox: {
    textAlign: 'left',
    alignSelf: 'stretch'
  },
  frameSpaceBlock: {
    marginTop: 25,
    alignSelf: 'stretch'
  },
  tusListasTypo: {
    fontSize: FontSize.size_sm,
    textAlign: 'left',
    color: Color.sportsVioleta,
    fontFamily: FontFamily.interBold,
    fontWeight: '700'
  },
  groupParentFlexBox: {
    alignItems: 'center',
    flexDirection: 'row'
  },
  frameLayout: {
    height: 20,
    marginLeft: 47
  },
  tusFavoritos: {
    fontSize: FontSize.size_5xl,
    color: Color.sportsVioleta,
    fontFamily: FontFamily.interBold,
    fontWeight: '700',
    textAlign: 'left'
  },
  frameWrapper: {
    justifyContent: 'center'
  },
  pruebasDeCiclismoWrapper: {
    flexDirection: 'row',
    alignSelf: 'stretch'
  },
  imGoingTo: {
    fontSize: FontSize.size_3xs,
    fontWeight: '500',
    fontFamily: FontFamily.interMedium,
    color: Color.sportsNaranja,
    marginTop: 5
  },
  frameGroup: {
    padding: Padding.p_3xs,
    flex: 1
  },
  frameContainer: {
    borderRadius: Border.br_3xs,
    borderStyle: 'solid',
    borderColor: Color.colorGainsboro_100,
    borderWidth: 1,
    flexDirection: 'row'
  },
  pruebasDeSenderismocaminata: {
    flex: 1
  },
  pruebasDeSenderismocaminataWrapper: {
    width: 212,
    flexDirection: 'row'
  },
  frameParent: {
    paddingTop: Padding.p_48xl,
    left: '50%',
    marginLeft: -180,
    paddingHorizontal: Padding.p_xl,
    top: 0
  },
  icon: {
    height: '100%',
    width: '100%'
  },
  wrapper: {
    width: 22,
    height: 25
  },
  vector: {
    width: 23,
    marginLeft: 47
  },
  capturaDePantalla20231124: {
    width: 33,
    height: 33,
    marginLeft: 47
  },
  container: {
    width: 20,
    marginLeft: 47
  },
  frame: {
    width: 19,
    marginLeft: 47
  },
  groupParent: {
    top: 10,
    left: 0,
    backgroundColor: Color.gris,
    height: 65,
    paddingVertical: Padding.p_3xs,
    justifyContent: 'center',
    paddingHorizontal: Padding.p_xl,
    width: 360,
    position: 'absolute'
  },
  menInferiorChild: {
    left: 165,
    width: 37,
    height: 24,
    top: 0,
    position: 'absolute'
  },
  menInferior: {
    bottom: 0,
    height: 75,
    width: 360,
    left: '50%',
    marginLeft: -180,
    position: 'absolute'
  },
  favoritos: {
    backgroundColor: Color.blanco,
    height: 800,
    overflow: 'hidden',
    width: '100%',
    flex: 1
  }
})

export default Favoritos1
